import {
  WECHAT_NEW
} from '../actions/types';

export default function(state = [], action) {
  const { type, payload } = action;

  // console.log(payload)

  switch(type) {
    case WECHAT_NEW:
      state = state.slice();
      state.push(action.payload)
      return state
    default:
      return state;
  }
}
